    false,nt"url": null,nt"notes": "This annual narrative report for Eastern
    Shore of Virginia National Wildlife Refuge outlines Refuge accomplishments during
    the 1985 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the master plan and management planning. Refuge administration
    is outlined; information about personnel, funding, and safety is given. Habitat
    management is also covered; subjects include forests, grasslands, and WPA easements.
    The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, and game mammals. The
    public uses of the Refuge described in this report include interpretive programs
    and law enforcement. The equipment and facilities section of the report provides
    information about rehabilitation, equipment replacement, communication systems,
    and energy conservation. Cooperative programs are provided at the end. Refuge brochures
    and field guides are attached.",nt"license_title": "License Not Specified",nt"extras":
